// RemoveWinner relationship.
// Sets o.R.Winner to nil.
// Removes o from all passed in related items' relationships struct.
func (o *Duel) RemoveWinner(ctx context.Context, exec boil.ContextExecutor, related *User) error {
	var err error

	queries.SetScanner(&o.WinnerID, nil)
	if _, err = o.Update(ctx, exec, boil.Whitelist("winner_id")); err != nil {
		return errors.Wrap(err, "failed to update local table")
	}

	if o.R != nil {
		o.R.Winner = nil
	}
	if related == nil || related.R == nil {
		return nil
	}

	for i, ri := range related.R.WinnerDuels {
		if queries.Equal(o.WinnerID, ri.WinnerID) {
			continue
		}

		ln := len(related.R.WinnerDuels)
		if ln > 1 && i < ln-1 {
			related.R.WinnerDuels[i] = related.R.WinnerDuels[ln-1]
		}
		related.R.WinnerDuels = related.R.WinnerDuels[:ln-1]
		break
	}
	return nil
}

// AddSolutions adds the given related objects to the existing relationships
